import classNames from "classnames";
import { useState } from "react";
import { PACKAGES } from "../../constants/Fixtires";
import { FormElem } from "../FormElem/FormElem"
import { InputRadioPeriod } from "../InputRadioPeriod/InputRadioPeriod";
import { PackageOption } from "../PackageOption/PackageOptions";
import styles from "./styles.module.css";

export const EditPackageForm = ({ togglePopup }) => {
  const [form, setForm] = useState({
    pack: PACKAGES.start,
    packagePeriod: undefined,
    officePeriod: undefined,
    office: false,
    packageDate: undefined,
    qr: false,
    frontOffice: undefined,
    tarification: false,
    mobile: undefined,
    officeCount: undefined,
  });

  const handleSubmit = (e) => {
    e.preventDefault();
  };

  return (
    <FormElem onSubmit={handleSubmit} 
    title={""} >
      <div className={styles.options_container}>
        <InputCountedOption label={'Станция'} requered={true} value={form.stantion} setValue={(val) => {setForm({...form, stantion: val})}} />
      </div>
    </FormElem>
  )
}
